SELECT SUM(anzahl_landwirtschaftliche_motorfahrzeuge)
FROM aargau_privatverkehr_bestand_nach_fahrzeugarten
WHERE jahr = 2010;

SELECT SUM(total_gwh) AS gesamt_erneuerbare_energie
FROM thurgau_erneuerbare_elektrizitatsproduktion_gemeinde
WHERE jahr BETWEEN 2017 AND 2021;

SELECT AVG(steuerbares_einkommen_mittelwert) AS durchschnittliches_steuerbares_einkommen_2014
FROM basel_stadt_steuerstatistik_kennzahlen_wohnvierteln
WHERE jahr = 2014;

SELECT (SUM(CASE WHEN rententyp = 'Zusatzrente für Ehepartner' AND geschlecht = 'Frau' THEN anzahl_renten ELSE 0 END) /
   SUM(CASE WHEN rententyp = 'Zusatzrente für Ehepartner' THEN anzahl_renten ELSE 0 END)) * 100 AS frauenanteil_zusatzrenten_fur_ehepartner
FROM ahv_renten_nach_wohnsitz_und_staatsangehoerigkeit;

SELECT SUM(anzahl_abstimmungsvorlagen) as gesamt_anzahl_abstimmungen
FROM abstimmungsvorlagen_seit_1971
WHERE jahr = 2000;

SELECT aufgabenbereich_cofog_feingliederung, ausgaben_in_mio_chf
FROM staatsausgaben_nach_aufgabenbereichen_cofog WHERE institutioneller_sektor = 'Bund' AND jahr = 2021
ORDER BY ausgaben_in_mio_chf DESC LIMIT 3;
